import React from 'react';

function NavbarItem(props) {
    return <div class="navbar-list-item">
        <div class="navbar-list-item-logo">
            <img src={props.logo} ClassName={props.title} alt={props.title} />
        </div>
        <div class="navbar-list-item-text title">
            <span>{props.title}</span>
        </div>
    </div>
}

export default NavbarItem;
